import * as fromTiendas from './tienda.acction';

export function TiendaReducer(
	state:any=[
		{id:"1",nombre:"Mary Kay",descripcion:"Mary Kay Cosmeticos",img:"data:image/jpeg;base64,"},
		{id:"2",nombre:"BMW",descripcion:"Coches de lujo",img:"data:image/jpeg;base64,"}
  	],action:fromTiendas.actions)
  {

	switch (action.type) {

		case fromTiendas.TIENDAS:
			return state;

		default:
			return state;
	}
}